import React, { Component, useState } from "react";
import Button from "react-bootstrap/Button";
import Form from "react-bootstrap/Form";
import InputGroup from "react-bootstrap/InputGroup";
import { useDispatch, useSelector } from "react-redux";
import { useNavigate } from "react-router-dom";
import { toast } from "react-toastify";

const Add = () => {
  const [Fname, setFname] = useState("");
  const [Lname, setLname] = useState("");
  const [email, setEmail] = useState("");
  const [salary, setSalary] = useState("");
  const [age, setAge] = useState("");
  const [height, setHeight] = useState("");
  const [gender, setGender] = useState("");

  const add = useSelector((state) => state);
  const dispatch = useDispatch();
  const navigate = useNavigate();

  const handleSubmit = (e) => {
    e.preventDefault();
    if (!Fname || !Lname || !email || !salary || !age || !height) {
      return toast.warning("Please fill all fildes!!!!");
    }
    const data = {
      id: add[add.length - 1].id + 1,
      Fname,
      Lname,
      email,
      salary,
      age,
      height,
      gender,
    };
    console.log(data);

    dispatch({ type: "ADD_EMPLOYEE", payload: data });
    toast.success("Employee added successfully!!");
    navigate("/");
  };

  return (
    <>
      <form onSubmit={handleSubmit}>
        <div style={{ width: 500, margin: "20px auto" }}>
          <h1 className="display-1 text-center">Add Employee</h1>
          <InputGroup className="mb-3">
            <Form.Label>First Name</Form.Label>
            <Form.Control
              size="lg"
              type="text"
              placeholder="First Name"
              value={Fname}
              onChange={(e) => setFname(e.target.value)}
            />
          </InputGroup>
          <br />
          <InputGroup className="mb-3">
            <Form.Label>Last Name</Form.Label>
            <Form.Control
              size="lg"
              type="text"
              placeholder="Last Name"
              value={Lname}
              onChange={(e) => setLname(e.target.value)}
            />
          </InputGroup>
          <br />
          <InputGroup className="mb-3">
            <Form.Label>Email</Form.Label>
            <Form.Control
              size="lg"
              type="text"
              placeholder="example@example.com"
              value={email}
              onChange={(e) => setEmail(e.target.value)}
            />
          </InputGroup>
          <br />
          <InputGroup className="mb-3">
            <Form.Label>Salary</Form.Label>
            <Form.Control
              size="lg"
              type="text"
              placeholder="$"
              value={salary}
              onChange={(e) => setSalary(e.target.value)}
            />
          </InputGroup>
          <br />
          <InputGroup className="mb-3">
            <Form.Label>Age</Form.Label>
            <Form.Control
              size="lg"
              type="text"
              placeholder="age"
              value={age}
              onChange={(e) => setAge(e.target.value)}
            />
          </InputGroup>
          <br />
          <InputGroup className="mb-3">
            <Form.Label>Height</Form.Label>
            <Form.Control
              size="lg"
              type="text"
              placeholder="in meters"
              value={height}
              onChange={(e) => setHeight(e.target.value)}
            />
          </InputGroup>
          <br />
          <InputGroup className="mb-3">
            <Form.Label>Gender</Form.Label>
            <Form>
              {["radio"].map((type) => (
                <div key={`inline-${type}`} className="mb-3">
                  <Form.Check
                    inline
                    label="Male"
                    name="group1"
                    type={type}
                    id={`inline-${type}-1`}
                    value={"Male"}
                    onChange={(e) => setGender(e.target.value)}
                  />
                  <Form.Check
                    inline
                    label="Female"
                    name="group1"
                    type={type}
                    id={`inline-${type}-2`}
                    value={"Male"}
                    onChange={(e) => setGender(e.target.value)}
                  />
                </div>
              ))}
            </Form>
          </InputGroup>
          <InputGroup className="mb-3">
            <Form.Group controlId="formFile" className="mb-3">
              <Form.Label>Attach personal Information</Form.Label>
              <Form.Control type="file" />
            </Form.Group>
          </InputGroup>
          <br />
          <InputGroup className="mb-3">
            <input
              className="btn btn-block btn-dark"
              type="submit"
              value="Add Student"
            />
          </InputGroup>
        </div>
      </form>
    </>
  );
};
export default Add;
